import './App.css';
import './Settings.css';
import './Profile.css';
import user_img from './user.png'
import chats_img from './comment.png'
import setting_img from './settings.png'
import logout_img from './logout.png'
import { Chats } from './components/Chats';
import { ChatArea } from './components/ChatArea';
import { Settings } from './components/SettingsArea';
import { checkCookie } from './checkcookie';
import { useState } from 'react';
import { Profile } from './components/ProfileArea';
function App(){
    const [state,set_state] = useState(1);
    const toggleTab = (index)=>{
        set_state(index)
    }
{if (checkCookie('name') === true){
    return(
    <>
        <div class="nav">
            <div className={state === 1 ? "nav_item_active":"nav_item"} onClick={() => toggleTab(1)}>
                <img src={user_img} alt=""/>
                <span>Profile</span>
            </div>
            <div className={state === 2 ? "nav_item_active":"nav_item"} onClick={() => toggleTab(2)}>
                <img src={chats_img} alt=""/>
                <span>Chats</span>
            </div>
            <div class={state === 3 ? "nav_item_active":"nav_item"} onClick={() => toggleTab(3)}>
                <img src={setting_img} alt=""/>
                <span>Settings</span>
            </div>
            <div class="nav_item">
                <img src={logout_img} alt=""/>
                <span>Log out</span>
            </div>
        </div>
        <div class="main_content">

            <div class="chat_wrapper">
                <div class="chat_list">
                    <input type="text" placeholder="search"/>
                    <div class="chats">
                        <Chats/>
                    </div>
                </div>
                <div class="main_area">
                    {state === 1 && <Profile/>}
                    {state === 2 && <ChatArea/>}
                    {state === 3 && <Settings/>}
                </div>
            </div>
            <div class="another_menu">

            </div>
        </div>
    </>
    );
}else{
    console.log('1');
}}
}
export default App;
